function debounce(fn, delay) {
  let timer = null;
  function debounceFn(...args) {
    const context = this;
    if (timer) {
      clearTimeout(timer);
      timer = null;
    }
    timer = setTimeout(() => {
      fn.apply(context, args);
    }, delay);
  }
  return debounceFn;
}

// sleep\u51FD\u6570
const sleep = async (delay) => {
  return new Promise((resole) => {
    setTimeout(resole, delay);
  });
};

// \u6D4B\u8BD5
